import React from 'react';
import './main.css';

export default function Main(){

    return (
        <>
            <div className="container">
                <div className="row"></div>        
                    <div style={{textAlign: 'center'}}>
                        <div className="card card-signin my-5" style={{padding: '5px'}}>
                            <div class="fb-profile">
                                <img align="left" class="fb-image-lg" src="http://lorempixel.com/850/280/nightlife/5/" alt="Wallpaper"/>
                                <img align="left" class="fb-image-profile thumbnail" src="http://localhost/frontend/src/pages/Main/gabriela.jpg" alt="Gabriela Silva"/>
                                <div class="fb-profile-text">
                                    <h1>Gabriela Silva</h1>
                                    <p>Girls just wanna go fun.</p>
                                </div>
                            </div>
                        </div>
                    </div>
            </div>

        </> 

    );
}
